import React, {Component} from 'react';
import './Alert.css'

class Alert extends Component {
    render() {
        let {isDisplay, message} = this.props;
        return (
            <div className="ng-alert-success">
                Vì em, vì em
            </div>
        );
    }
}

export default Alert;
